import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout';
import axios from 'axios';
import Link from 'next/link';


class Cv extends React.Component{

	render() {
		const data = {
		  content: {
		    body: [
		      {
		        _uid: "BUY6Drn9e1",
		        component: "foo",
		        headline: "Foo"
		      },
		      {
		        _uid: "gJZoSLkfZV",
		        component: "bar",
		        title: "Bar"
		      },
		      {
		        _uid: "X1JAfdsZxy",
		        component: "foo",
		        headline: "Another headline"
		      }
		    ]
		  }
		};	
		// debugger
		const titleval = "hiii"
		this.state = { para: "hello", h1: "some"}
		var { para } = this.state;
		const { h1 } = this.state;
		const i = 0;
		return(
	  	 <BaseLayout>
		  	<h1>New CV Page</h1>
		  	<div className="App">
		      {data.content.body.map(block => block.headline)[i]}{i++}
		    </div>
		  	<div>
		  		<p>{ titleval }</p>
		  		<h1>{ para }</h1>
		  		<h1>{ h1 }</h1>
		  	</div>
	  	</BaseLayout>
	  	)
	}
}
export default Cv;
